    false,nt"url": null,nt"notes": "The American Samoa Coastal use Participatory
    Mapping Project was developed through a partnership between the American Samoa Government's
    Department of Commerce Coastal Management Program (ASCMP), Department of Marine
    and Wildlife Resources (DMWR), NOAA's Pacific Islands Regional Office (PIRO), NOAA
    Coral Reef Conservation Program (CRCP) and NOAA's Coastal Services Center - Pacific
    Regeion (PSC). The project was designed to enhance ocean management by gathering
    geospatial data on human uses of the nearshore ocean environment in the Fagaloa
    region of the island of Tutuial in American Samoa. The data were collected from
    regional ocean experts and users through participatory GIS methods.",nt"owner_org":
